import { useState } from "react";

export default function AccountList() {
  const [accounts, setAccount] = useState("");
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Account_name</th>
            <th>Currency</th>
          </tr>
        </thead>
        <tbody>
          {accounts &&
            accounts.map((item) => (
              <tr key={item.id}>
                {" "}
                {/* âœ… Add key here */}
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.currency}</td>
                <td>{item.balance}</td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
}
